    "parameters": {
        "ProgressVariable": "11",
        "ProgressText": "[\"Shake off the pursuers and escape through the forest.\",\"\",\"I want to give a flower decoration to Lunaroa! Lets go to the hill behind the west!\",\"\",\"The flower decoration is done! My mom should see it.\",\"\",\"I have to escape safely from the village quickly.\",\"\",\"Lets go to Yurishin with Lunaroa.\",\"\",\"I have to go to the northwest Mottrell Mine to help Rebecca!\",\"Rescue Rebecca! Lets get out of the mine for now.\",\"Head to Yurishin in the west.\",\"\",\"Something strange...? Lets escape the sewer with Black Uniform Girl.\",\"---Rank 1---\",\"Lets take a request at the Guild!!\",\"\",\"Cross Toomawari Hill and go to inspect Hajikko Village.\",\"The fight of The Strongest Combo...!\",\"Lets go back to Yurishin with Vita.\",\"Im delighted to see you in the product version after clearing the pre-experience version.\",\"Money is the first thing! Lets take on a task at the Guild!!\",\"\",\"Lets go to meet the Futanari Scholar who is said to be deep inside the cave.\",\"\",\"Lets go back to Yurishin! Somethings strange about Lunaroa.\",\"---Rank 2---\",\"Lets go to the Guild to meet up with Crya.\",\"\",\"I have to rescue Laura and her friends as soon as possible.\",\"\",\"It seems that Vega has something to look for. Lets proceed to the back of the prison.\",\"\",\"Get out of the Forest of Escape and aim for Yurishin.\",\"---Rank 3---\",\"We need more money for four people living! Lets take on a request at the Guild!!\",\"\",\"Defeat the Monster at the back of the Buried Gold Excavation Site!!\",\"\",\"Take a request at the Guild! Something seems to be bothering Vita.\",\"\",\"Lets take on a Quest from the Guild! This time Lunaroa is the main character...?\",\"\",\"Lets go to the Underground Waterway while taking a little walk on Cordain.\",\"Lets proceed to the back of the Cordain underground waterway.\",\"...If we dont get the exam over.\",\"\",\"Lets take a Quest from the Guild! It seems like we are going to Hajikko Village.\",\"\",\"Lets take a Quest from the Guild. This time it seems to be alone with Vega.\",\"\",\"Lets ask Village Chief of Elmo Village\",\"\",\"With Melissa and others, lets go pick some Mercury grass.\",\"It seems the Village Chief has got us a Lodge. Lets gratefully stay the night.\",\"To confirm safety, to the Village Chiefs house!!\",\"\",\"Lets get through the Air Raid Shelter and aim for Yurishin.\",\"\",\"Lets take a Quest from the Guild. This time it seems to be a request from the girls...?\",\"\",\"Lets take a Quest from the Guild. Yet again, something about Vita...?\",\"---Rank 4---\",\"Lets clear the four trials from the Guild! Power up!!\",\"\",\"Lets conquer the Trial of the Earth! Something seems ominous...?\",\"\",\"Somethings off about the atmosphere. Lets proceed.\",\"\",\"Lets take a Quest from the Guild. Seems like Vita is acting strange again...?\",\"---Rank 5---\",\"Lets take a request from the Guild. The final battle with Cordain...\",\"\",\"Lets get through the Underground Waterway and invade Cordain.\",\"\",\"Lets invade Cordain Castle.\",\"\",\"...We must press on. The Director should be at the deepest part of the castle.\",\"Lets settle things with Cordain.\",\"... We have to do something about this situation.\",\"Lets go to Lunaroas room...!\",\"----Part 2----\",\"\",\"Commence operation!! Scatter Cordains remnants and succeed in diversion.\",\"\",\"Lets take control over the remaining tower.\",\"Cross the border and aim for Cordain. First, to the Guild.\",\"As the day closes... We have to hurry to Cordain.\",\"---Rank 6---\",\"Lets go to the Guild. There seems to be a story related to Vega...\",\"\",\"Clean the toilet...!\",\"\",\"Gather information inside the mansion.\",\"\",\"Ask the gardener Yard about the key.\",\"\",\"Lets join Vega as a separate team.\",\"\",\"Lets try going to the Guild.\",\"Lets get through the Snowy Forest and go to see the Witch in Yukiiful.\",\"Go with Eel-chan and conquer Marias Dream.\",\"\",\"Alice has joined the team. Something strange is happening...\",\"\",\"From the cave north of Yukiiful, lets meet the wizard.\",\"\",\"...I met someone unexpected. Lets go hear Chairman-sans conditions.\",\"Lets convince Chairman-san of my abilities.\",\"Preparations are in order. Lets go to Lunaroas dream.\",\"---Rank 7---\",\"Surpass the seven trials in Lunaroas Dream and advance.\",\"\",\"There is no choice but to move ahead.\",\"\",\"Lets meet Lunaroa.\",\"\",\"We have to take a bath with Lunaroa!\",\"Its a break! Watch the Ending from the guild.\",\"Thank you for playing the main story!\"]",
        "TextWidthAutoAdjust": "false",
        "WindowLayout": ""
    }
